import { StatusBar } from "expo-status-bar";
import { useContext, useEffect, useState } from "react";
import {
  Button,
  Platform,
  StyleSheet,
  Text,
  TextInput,
  View,
} from "react-native";
import MapView, { Marker, Region } from "react-native-maps";
import { SafeAreaView } from "react-native-safe-area-context";
import SquadContext from "../contexts/squad-context";
import { BarSquad } from "../controller/squad-session";

import { PROVIDER_GOOGLE } from "react-native-maps";
import squadController from "../controller/squad.controller";
import * as Location from "expo-location";

const PinImageDataUri =
  "data:image/png;base64,";

export default function SquadView() {
  const { squad, setSquad } = useContext<BarSquad.SquadContext>(SquadContext);
  if (squad)
    squad.members = [
      { name: "Anders" },
      { name: "Adrian" },
      { name: "Sauen" },
      {
        name: "Knut Egil",
        location: {
          lat: 62.83958471907604,
          lng: 7.236805824968001,
        },
      },
      { name: "Christoffer" },
      { name: "Martin" },
    ];

  useEffect(() => {
    Location.getCurrentPositionAsync()
      .then((pos) => {
        // Set location!
        if (pos) {
          //setInitialLocation(pos)
          const currRegion: Region = {
            latitude: pos.coords.latitude,
            longitude: pos.coords.longitude,
            latitudeDelta: 0.002,
            longitudeDelta: 0.002,
          };
          setInitialLocation(currRegion);
        }
      })
      .catch((err) => {
        console.error("Failed getting current user location");
      });
  }, []);

  const [initialLocation, setInitialLocation] = useState<Region>();

  return (
    <SafeAreaView style={styles.container}>
      <View style={styles.squadInfo}>
        <Text style={styles.text}>{squad?.name ?? "The Squad"}</Text>
        <View style={styles.members}>
          {squad?.members?.map((member, idx) => (
            <Text style={styles.text} key={member.name}>
              {member.name}
              {idx + 1 < squad.members.length ? "," : ""}
            </Text>
          )) || <Text style={styles.text}>"No members"</Text>}
        </View>
      </View>

      <MapView
        style={styles.map}
        provider={PROVIDER_GOOGLE}
        showsUserLocation={true}
        followsUserLocation={true}
        showsMyLocationButton={true}
        region={initialLocation}
      >
        {squad?.members
          .filter((member) => {
            return member.name !== squadController.getUsername();
          })
          .map((member, idx) => {
            if (!member.location) return;
            return (
              <Marker
                key={member.name}
                coordinate={{
                  latitude: member.location.lat,
                  longitude: member.location.lng,
                }}
                image={{ uri: PinImageDataUri, scale: 0.01 }}
                title={member.name}
                description={`Last seen: ${(
                  ((member.last_seen ?? 0) - Date.now()) /
                  1000
                ).toFixed(0)} seconds ago`}
              />
            );
          })}
      </MapView>

      <StatusBar style="auto" />
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingTop: 40,

    backgroundColor: "#101020",
  },

  squadInfo: {
    flex: 0,

    paddingVertical: 40,
    height: "auto",

    alignItems: "center",
    justifyContent: "center",
  },

  text: {
    color: "#ffffff",
  },
  members: {
    flex: 0,
    flexDirection: "row",

    margin: 8,
    maxWidth: "80%",

    flexWrap: "wrap",
    justifyContent: "flex-start",

    gap: 4,
  },

  map: {
    flex: 1,
    width: "100%",
    backgroundColor: "#0000ff",
    height: "auto",
  },
});
